import React from 'react';
import Navbar from '../HomePage/Navbar/Navbar';

const NotFound404 = () => {
  return (
    <div>
      <Navbar />
      <img
        style={{
          border: "5px solid black",
          width: "30%",
          margin: "auto", // Center-align the image horizontally
          display: "block", // Ensure the image is treated as a block element
        }}
        src="https://img.freepik.com/free-vector/oops-404-error-with-broken-robot-concept-illustration_114360-1932.jpg?size=626&ext=jpg&ga=GA1.1.348035570.1694454835&semt=ais"
        alt=""
      />
    </div>
  );
};

export default NotFound404;
